  [],\n\t\"revision_timestamp\": \"2013-03-15T21:27:23.657833\",\n\t\"name\": \"digital-data-sets-that-describe-aquifer-characteristics-of-the-antlers-aquifer-in-southeastern-544c2\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set consists of digitized water-level
  elevation contours for the Antlers aquifer in southeastern Oklahoma. The Early Cretaceous-age
  Antlers Sandstone is an important source of water in an area that underlies about
  4,400-square miles of all or part of Atoka, Bryan, Carter, Choctaw, Johnston, Love,
  Marshall, McCurtain, and Pushmataha Counties. The Antlers aquifer consists of sand,
  clay, conglomerate, and limestone in the outcrop area. The upper part of the Antlers
  aquifer consists of beds of sand, poorly cemented sandstone, sandy shale, silt,
  and clay. The Antlers aquifer is unconfined where it outcrops in about an 1,800-square-mile
  area. The water-level elevation contours were digitized from a mylar map at a scale
  of 1:250,000 that was used to prepare a final map published at a scale of 1:500,000
  in a ground-water modeling report. Water levels measured in wells in 1970 were used
  to construct the map. The water-level elevation contours for the Antlers aquifer
  in Texas are not included in this data set. The digital data set contains water-level
  elevations that range from 300 feet (in the east) to 900 feet (in the west) above
  sea level or the National Geodetic Vertical Datum of 1929.\",\n\t\"license_title\":
